  false,\n\t\"url\": null,\n\t\"notes\": \"From February to May 1987 the U.S. Geological
  Survey (USGS) conducted five cruises to cover the U.S. Atlantic Continental Margin
  Exclusive Economic Zone (EEZ) seaward of the continental shelf edge, and from the
  Canadian border southward to the northern Blake Plateau off Florida. As in earlier
  EEZ reconnaissance surveys, the USGS utilized the GLORIA (Geological LOng-Range
  Inclined Asdic) sidescan-sonar system to complete the geologic mapping. The collected
  GLORIA data were processed and digitally mosaicked to produce continuous imagery
  of the seafloor. Twenty-three digital mosaics of a 2 degree by 2 degree (or smaller)
  area with a 50-meter pixel resolution were completed for the U.S. Atlantic Continental
  Margin region.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
